import logo from './logo.svg';
import '../node_modules/bootstrap/dist/css/bootstrap.min.css';
import Header from './components/Header';
import Footer from './components/Footer';
import Content from './components/Content';
import Form from './components/form';
import Background from './components/Background';
import Intro from './components/Intro';
import React, { Component, useState, useEffect, useRef } from 'react';
import db from './components/utils/firebase.config';
import { collection, addDoc, setDoc, getDocs, doc, onSnapshot } from "firebase/firestore";


function App() {
  const [allSubs, setAllSubs] = useState([]);
  let responseArray = [];

  useEffect(() => {
    // getDocs(collection(db, "Responses"))
    //   .then(response => {
    //     response.forEach((doc) => {
    //       responseArray.push(doc.data());
    //     });
    //   });

    getDocs(collection(db, "Responses"))
      .then(response => {
        response.forEach((doc) => {
          setAllSubs(prev => [...prev, response]);
          responseArray.push(doc.data());
        });
      });

    // setAllSubs(['aaa']);
    console.log('res array 2', allSubs);
  }, []);


  return (
    <div className="App">
      <Background />
      <Content />
      <Intro />
      <Header />
      <Footer />
    </div>
  );
}

export default App;
